import React from "react";
import "../hojas-de-estilo/Form.css";
import { useState } from "react";

const Form = () => {
  const [useData, setUseData] = useState({
    email: "",
    password: "",
  });

  const handleChange = (event) => {
    setUseData({
      ...useData,
      [event.target.name]:event.target.value,
    });
  }

  return (
    <div className="form-component">
      <form action="">
        <img
          className="logo"
          src={require(`../imagen/Rick-And-Morty.png`)}
          alt="Login Rick"
        />
        <label className="texto" htmlFor="email">
          Email:{" "}
        </label>
        <input
          type="text"
          value={useData.email}
          placeholder="abc@gmail.com"
          required
        />

        <label className="texto" htmlFor="password">
          Password
        </label>
        <input
          type="password"
          value={useData.password}
          placeholder="*************"
          required
        />
        <button className="btn-envio">Submit</button>
      </form>
    </div>
  );
};

export default Form;
